INSERT INTO service_categories VALUES(2,'Skilled Nursing & Medical Care','This category is essential because it brings hospital-level clinical expertise to the patients home. Services like wound care, IV therapy, and chronic illness management (e.g., for diabetes or COPD) must be performed by licensed nurses. UHcare''s skilled care is necessary to safely monitor complex conditions, administer prescribed treatments, and prevent costly readmissions, ensuring a high quality of medical recovery right at home.','https://static.vecteezy.com/system/resources/previews/045/717/747/non_2x/illustration-of-medical-nurse-logo-icon-vector.jpg',1,10,'skilled-nursing-medical-care');
INSERT INTO service_categories VALUES(3,'Personal/Custodial Care','Personal/Custodial Care is vital for maintaining the patient''s dignity, hygiene, and daily safety. For patients with limited mobility or cognitive impairment (like Dementia), help with bathing, dressing, grooming, and safe transfers is non-negotiable. UHcare''s aides provide this essential support, ensuring basic needs are met and reducing the risk of accidents like falls, allowing the patient to remain comfortable and independent in their familiar environment.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQP_9mF3tOVGw_9ub9XfF1qhqTafaw1QeCTPg&s',1,10,'Personal_Care');
INSERT INTO service_categories VALUES(4,'Rehabilitative Therapy','Rehabilitative Therapy is necessary to restore function and maximize independence after a stroke, injury, or surgery. UHcares therapists provide customized Physiotherapy and other therapies right at home. This setting is optimal because exercises are practiced in the patient''s actual living space (navigating stairs, kitchen), making the rehabilitation highly practical and effective for achieving long-term functional goals.','https://t3.ftcdn.net/jpg/03/15/28/06/360_F_315280673_XFNhwYUTY4HTH51BbmFBdKMUR68e7UmU.jpg',1,10,'Rehabilitative_therapy');
