INSERT INTO medicine_categories VALUES(1,'cetamol','cetamol','khaii','https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.vecteezy.com%2Ffree-vector%2Fparacetamol&psig=AOvVaw0OvO1dRXtxEGmFJBichCBM&ust=1761921331761000&source=images&cd=vfe&opi=89978449&ved=0CBgQjhxqFwo',1,1000);
INSERT INTO medicine_categories VALUES(2,'Skin Medicnine','skin-medicnine','Skin medicine refers to creams, ointments, or tablets used to treat various skin conditions such as acne, eczema, psoriasis, infections, and allergies. These medicines help reduce inflammation, itching, redness, and bacterial growth. Common types include antifungal creams, steroid ointments, moisturizers, and antibiotic treatments for healthy skin recovery.','https://www.trucare.com.np/wp-content/uploads/2023/06/42867d6454dc0f2874f7866655ce49e96f1f5abc.jpg',1,56);
INSERT INTO medicine_categories VALUES(3,'Non-Steroidal Anti-Inflammatory Drugs (NSAIDs)','NSAID','A class of drugs that reduce pain (analgesic), reduce fever (antipyretic), and, most notably, reduce inflammation (anti-inflammatory). They work by inhibiting the cyclooxygenase (COX) enzymes, which are responsible for producing prostaglandins that mediate pain and inflammation.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQokTfi1cV4cnAk4GdQn6FZhGZlj7U50Epeig&s',1,50);
INSERT INTO medicine_categories VALUES(4,'Non-Narcotic Analgesic and Antipyretic','Simple_Analgesic_Antipyretic','A drug class primarily used for the management of mild to moderate pain and fever. Unlike NSAIDs, they have very little to no clinically significant anti-inflammatory effects. They work mainly centrally (in the brain) to raise the pain threshold.','https://cdn.britannica.com/53/143753-050-047EDA67/Aspirin-pills.jpg',1,50);
INSERT INTO medicine_categories VALUES(5,'Antihistamine (H1 Receptor Antagonist)','H1-Antihistamine','Medications used to block the effects of histamine, a chemical released by the body during allergic reactions. They are primarily used to treat symptoms of allergies, such as sneezing, runny nose, itching, and hives. First-generation types often cause drowsiness, while newer ones (second/third generation) are non-sedating.',NULL,1,50);
INSERT INTO medicine_categories VALUES(6,'Proton Pump Inhibitors (PPIs)','proton-pump-inhibitors-ppis','A class of drugs that cause a profound and prolonged reduction of stomach acid production. They work by irreversibly blocking the H+/K+ ATPase enzyme system (the "proton pump") in the stomach lining cells, which is the final step in acid secretion. Used for ulcers and severe acid reflux (GERD).','https://img.medscape.com/thumbnail_library/is_191126_gi_tract_large_intestine_800x450.jpg',1,50);
INSERT INTO medicine_categories VALUES(7,'Antacids','antacids','Over-the-counter medications that work by chemically neutralizing existing stomach acid. They provide fast, short-term relief from heartburn and indigestion but do not stop the production of acid.','https://hips.hearstapps.com/hmg-prod/images/281/gettyimages-177124319-1518183125.jpg?resize=640:*',1,50);
INSERT INTO medicine_categories VALUES(8,'Macrolide Antibiotics','macrolide-antibiotics','A class of broad-spectrum antibiotics used to treat various bacterial infections, especially respiratory, skin, and certain atypical infections. They work by inhibiting bacterial protein synthesis by binding to the 50S ribosomal subunit. They are often a choice for patients with penicillin allergies.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQpT9mqK9XBo82VyW-RH0VWqbMQDmt-Q0A-Vg&s',1,50);
INSERT INTO medicine_categories VALUES(9,'Penicillin Antibiotics','penicillin-antibiotics','A class of lactam antibiotics that work by interfering with bacterial cell wall synthesis, leading to the rupture and death of the bacterial cell. They are widely used for common bacterial infections.','https://allergyasthmanetwork.org/wp-content/uploads/2024/10/penicillin-pills-1080x567.jpg',1,50);
INSERT INTO medicine_categories VALUES(10,'Antifungal Agent','antifungal-agent','Medications used to treat fungal infections (mycoses) in the body, which can be superficial (skin, nails) or systemic (internal organs). They work by damaging the fungal cell membrane or inhibiting fungal cell growth.','https://static.vecteezy.com/system/resources/thumbnails/024/255/123/small/glyph-antibacterial-icon-in-flat-style-vector.jpg',1,50);
