INSERT INTO medicines VALUES(2,'Retiderm','retiderm','tretinoin','sdf','Retiderm is a dermatological cream containing retinol or tretinoin, commonly used to treat acne, wrinkles, and uneven skin tone. It promotes skin cell renewal, reduces fine lines, and improves texture. Regular use under medical guidance helps achieve smoother, healthier skin by stimulating collagen production and unclogging pores.','rth','erye','ry','eryher','cream','500mg',12,200,41,10,'not_required','https://www.trucare.com.np/wp-content/uploads/2023/06/42867d6454dc0f2874f7866655ce49e96f1f5abc.jpg',1,0,'2025-11-03 11:53:00.096736','2025-11-08 05:03:01.708017',9,2,'');
INSERT INTO medicines VALUES(3,'Paracetamol','paracetamol','Paracetamol','Many (Various Nepali and Indian companies)','Reduces pain by acting centrally in the brain and reduces fever by affecting the body''s heat-regulating center. (            )','Fever (), Headache ( ), Body pain ( ), Toothache ( ), Menstrual pain ( ).','Generally safe at recommended dose. Rare: Skin rash, allergic reaction. Severe Risk: Liver damage with overdose (       ).','Adults: 500mg or 650mg, every 4 to 6 hours as needed. Do not exceed 8 tablets (4000mg) in 24 hours. (     )','DO NOT OVERDOSE. Avoid or limit alcohol while taking. Consult a doctor if fever lasts more than 3 days. (    )','tablet','500mg, 650mg (Tablet)',10,15,49,10,'not_required','https://www.watranpharmaceuticals.com/wp-content/uploads/2023/05/WhatsApp-Image-2024-02-01-at-2.51.18-PM-10.jpeg',1,0,'2025-11-11 14:55:36.893565','2025-11-16 13:26:41.158178',1,4,'');
INSERT INTO medicines VALUES(4,'Cetirizine','cetirizine','Cetirizine Dihydrochloride','','Cetirizine Dihydrochloride','Allergic Rhinitis (   ), Hay fever, Hives (  ), Itching (), Runny nose (/ ).','Common: Drowsiness ( ), Dry mouth. Less common: Fatigue, headache.','Adults: 10mg once daily. Usually taken in the evening if it causes drowsiness. (    mg )','Although considered non-sedating, it can still cause drowsiness in some. Use caution when driving or operating heavy machinery. (     )','tablet','10mg (Tablet).',10,100,98,10,'not_required','https://cdn.foxpharma.co.uk/wp-content/uploads/2024/09/Cetirizine-10mg.jpg',1,0,'2025-11-11 14:59:46.049353','2025-11-16 13:20:55.508535',2,5,'');
INSERT INTO medicines VALUES(5,'Omeprazole','omeprazole','Omeprazole','','Blocks the system in the stomach lining that produces acid, providing prolonged relief from acidity. (       )','Heartburn ( ), Stomach and Duodenal Ulcers (    ), GERD (Acid Reflux Disease) (   ).','Headache, Abdominal pain ( ), Nausea, Diarrhea/Constipation. Long-term use requires doctor monitoring.','Typically 20mg or 40mg, once daily. Take 30 minutes before the first meal of the day. Swallow whole, do not crush. (       )','Long-term use may reduce the absorption of certain vitamins and minerals (like Vitamin B12 and Calcium). Use for the shortest duration necessary as advised by a doctor.','capsule','20mg, 40mg.',10,50,100,10,'not_required','https://cdn.shopify.com/s/files/1/0012/8440/7394/files/omeprazole-capsules-20mg-sandoz-1157733404.webp?v=1745382282',1,0,'2025-11-11 15:02:20.548787','2025-11-11 15:02:20.548823',0,6,'');
