INSERT INTO equipment_categories VALUES(1,'Medical_eqi','Medical_eqi',unistr('Medical equipment comprises devices, apparatus, and instruments used for diagnosis, monitoring, treatment, and care of patients.\u000d\u000a\u000d\u000aThey are essential as they enable healthcare professionals to accurately identify illnesses, monitor vital signs (like heart rate and blood pressure), and deliver precise, life-saving therapies and surgical interventions, ultimately improving patient outcomes and recovery.'),'2025-10-30 14:31:02.194231',20,1,'2025-11-10 09:07:25.154134');
INSERT INTO equipment_categories VALUES(2,'Medical supplies','medical-supplies','Medical supplies are essential items used in healthcare settings for patient care, diagnosis, and treatment. They include bandages, syringes, gloves, masks, thermometers, and disinfectants. These supplies ensure hygiene, safety, and effective medical procedures, helping doctors and nurses provide proper care and prevent infections in hospitals and clinics.','2025-11-03 10:08:36.780918',20,1,'2025-11-03 10:08:36.780953');
INSERT INTO equipment_categories VALUES(3,'Respiratory & Airway Support','respiratory-airway-support','This category includes devices like oxygen concentrators and CPAP machines. They are necessary for patients with conditions such as COPD, asthma, or sleep apnea who struggle to breathe or maintain adequate blood oxygen levels. The equipment''s function is to deliver filtered, pressurized, or concentrated air to ensure the patient''s lungs receive enough oxygen, reducing respiratory distress and sustaining vital functions.','2025-11-10 09:06:08.488354',10,1,'2025-11-10 09:06:08.488382');
INSERT INTO equipment_categories VALUES(4,'Mobility & Accessibility','mobility-accessibility','This encompasses items like wheelchairs, walkers, and patient lifts. They are necessary for patients recovering from surgery, injury, or living with chronic conditions that impair their ability to walk. These devices provide the patient with safe movement, stability, and support for ambulation or transfers. Their use restores independence, prevents falls and further injury, and allows the patient to participate in daily life.','2025-11-10 09:06:25.614044',10,1,'2025-11-10 09:06:25.614073');
INSERT INTO equipment_categories VALUES(5,'Hospital Beds & Comfort','hospital-beds-comfort','This includes specialized equipment like adjustable hospital beds and pressure-reducing mattresses. They are necessary for patients who are bedridden or spend significant time recovering in bed. The equipment allows for easy, safe positioning (e.g., raising the head or feet) to improve circulation, reduce the risk of bedsores (pressure ulcers), and aid caregivers with hygiene and feeding. They ensure the patient''s safety and comfort during their recovery.','2025-11-10 09:06:48.156817',10,1,'2025-11-10 09:06:48.156854');
INSERT INTO equipment_categories VALUES(6,'Monitoring & Therapy','monitoring-therapy','This category covers devices like infusion pumps, pulse oximeters, and DVT pumps. They are necessary to deliver precise medical treatment and track a patient''s physiological status outside of a clinical setting. Monitoring devices alert caregivers to dangerous changes in vital signs, while therapy devices administer medications or prevent complications (like blood clots). This equipment is vital for maintaining therapeutic goals and ensuring immediate safety.','2025-11-10 09:07:01.638663',10,1,'2025-11-10 09:07:01.638696');
