INSERT INTO equipments VALUES(2,'OXYGEN CYLINDER','oxygen-cylinder','An oxygen cylinder is a medical device that stores compressed oxygen for patients with breathing difficulties. It provides a steady flow of oxygen to support respiration in conditions like asthma, COPD, or emergencies. Oxygen cylinders are used in hospitals, ambulances, and home care to maintain adequate oxygen levels.','https://rent.oxygendelivers.com/cdn/shop/products/PortableOxygenCylinderOxygenDelivers.jpg?v=1660004363',5000,1,3,2,'2025-11-03 10:10:21.490710',2000,1000,500,0,0,15,'2025-11-16 13:20:30.814596','','','excellent','',0,'','','',50);
INSERT INTO equipments VALUES(3,'Oxygen Concentrators','oxygen-concentrators','These devices filter and concentrate ambient air to deliver a high percentage of pure oxygen to the patient via a mask or nasal cannula. They are necessary when a patients blood oxygen levels are low due to conditions like COPD or pneumonia. The equipment helps ensure tissues and organs get the oxygen needed to function, preventing strain and improving breathing.','https://www.healme.com.np/storage/Product/PR-1687007936-5785531.webp',84000,1,3,10,'2025-11-10 09:11:05.647231',200,100,500,0,0,15,'2025-11-10 09:11:05.647266','','','excellent','',0,'','','',50);
INSERT INTO equipments VALUES(4,'CPAP/BiPAP Machines','cpapbipap-machines','These machines deliver pressurized air through a mask to keep the patient''s airway open during sleep or respiratory distress. They are necessary to treat conditions like severe sleep apnea and certain lung diseases. The continuous pressure prevents airway collapse, ensuring consistent breathing and restful, restorative sleep.','https://www.healme.com.np/storage/Product/PR-1687008522-1974345.webp',120000,1,3,9,'2025-11-10 09:14:10.724533',200,100,500,0,0,15,'2025-11-16 13:19:54.457979','','','excellent','',0,'','','',50);
INSERT INTO equipments VALUES(5,'Wheelchairs','wheelchairs','A wheelchair is a mobile chair designed to be propelled manually or by battery power. It is necessary for patients who have limited to no ability to walk due to injury, surgery, or chronic illness. The equipment provides mobility, independence, and access to daily activities, preventing social isolation and allowing engagement with their environment.','https://www.aidacare.com.au/globalassets/catalogue/categoryimage/landing270x330/manualwheelchairs_land.png',12000,1,4,10,'2025-11-10 09:16:59.769225',200,100,500,0,0,15,'2025-11-10 09:16:59.769252','','','excellent','',0,'','','',50);
