PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "wishlists" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "added_at" datetime NOT NULL, "service_id" bigint NOT NULL REFERENCES "services" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "patient_profiles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "medical_history" text NOT NULL, "blood_group" varchar(5) NOT NULL, "total_balance" decimal NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "provider_profiles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "specialization" varchar(50) NOT NULL, "license_number" varchar(50) NOT NULL UNIQUE, "years_of_experience" integer unsigned NOT NULL CHECK ("years_of_experience" >= 0), "bio" text NOT NULL, "hourly_rate" decimal NOT NULL, "is_available" bool NOT NULL, "rating" decimal NOT NULL, "total_reviews" integer unsigned NOT NULL CHECK ("total_reviews" >= 0), "user_id" bigint NOT NULL UNIQUE REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "provider_availability" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "day_of_week" integer NOT NULL, "start_time" time NOT NULL, "end_time" time NOT NULL, "is_available" bool NOT NULL, "provider_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "appointments" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "appointment_date" date NOT NULL, "appointment_time" time NOT NULL, "duration_hours" decimal NOT NULL, "service_address" text NOT NULL, "service_price" decimal NOT NULL, "additional_charges" decimal NOT NULL, "total_amount" decimal NOT NULL, "status" varchar(20) NOT NULL, "patient_notes" text NOT NULL, "provider_notes" text NOT NULL, "cancellation_reason" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "confirmed_at" datetime NULL, "completed_at" datetime NULL, "patient_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "provider_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "service_id" bigint NOT NULL REFERENCES "services" ("id") DEFERRABLE INITIALLY DEFERRED, "final_price" decimal NULL);
CREATE TABLE IF NOT EXISTS "service_categories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "description" text NOT NULL, "icon" varchar(200) NULL, "is_active" bool NOT NULL, "display_order" integer unsigned NOT NULL CHECK ("display_order" >= 0), "slug" varchar(120) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "personal_appointments" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "appointment_type" varchar(50) NOT NULL, "appointment_date" date NOT NULL, "appointment_time" time NOT NULL, "duration_minutes" integer NOT NULL, "location_type" varchar(20) NOT NULL, "location_address" text NOT NULL, "video_link" varchar(200) NOT NULL, "reason" text NOT NULL, "symptoms" text NOT NULL, "patient_notes" text NOT NULL, "provider_notes" text NOT NULL, "diagnosis" text NOT NULL, "prescription" text NOT NULL, "consultation_fee" decimal NOT NULL, "additional_charges" decimal NOT NULL, "total_fee" decimal NOT NULL, "status" varchar(50) NOT NULL, "cancellation_reason" text NOT NULL, "cancelled_at" datetime NULL, "reminder_sent" bool NOT NULL, "reminder_sent_at" datetime NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "confirmed_at" datetime NULL, "completed_at" datetime NULL, "patient_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "provider_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "appointment_reviews" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" integer NOT NULL, "review_text" text NOT NULL, "would_recommend" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "appointment_id" bigint NOT NULL UNIQUE REFERENCES "personal_appointments" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "provider_schedules" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "day_of_week" integer NOT NULL, "start_time" time NOT NULL, "end_time" time NOT NULL, "slot_duration" integer NOT NULL, "is_available" bool NOT NULL, "provider_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "carts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cart_type" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "medicine_categories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "slug" varchar(100) NOT NULL UNIQUE, "description" text NOT NULL, "icon" varchar(200) NULL, "is_active" bool NOT NULL, "display_order" integer unsigned NOT NULL CHECK ("display_order" >= 0));
CREATE TABLE IF NOT EXISTS "pharmacy_orders" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "order_number" varchar(50) NOT NULL UNIQUE, "delivery_address" text NOT NULL, "delivery_phone" varchar(15) NOT NULL, "delivery_instructions" text NOT NULL, "prescription_image" varchar(200) NULL, "prescription_verified" bool NOT NULL, "subtotal" decimal NOT NULL, "delivery_charge" decimal NOT NULL, "discount" decimal NOT NULL, "total_amount" decimal NOT NULL, "status" varchar(20) NOT NULL, "delivered_at" datetime NULL, "delivery_person" varchar(100) NOT NULL, "customer_notes" text NOT NULL, "internal_notes" text NOT NULL, "cancellation_reason" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "customer_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "medicines" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "slug" varchar(200) NOT NULL UNIQUE, "generic_name" varchar(200) NOT NULL, "manufacturer" varchar(200) NOT NULL, "description" text NOT NULL, "uses" text NOT NULL, "side_effects" text NOT NULL, "dosage_instructions" text NOT NULL, "warnings" text NOT NULL, "unit_type" varchar(20) NOT NULL, "strength" varchar(50) NOT NULL, "package_size" integer unsigned NOT NULL CHECK ("package_size" >= 0), "price" decimal NOT NULL, "stock_quantity" integer unsigned NOT NULL CHECK ("stock_quantity" >= 0), "low_stock_threshold" integer unsigned NOT NULL CHECK ("low_stock_threshold" >= 0), "prescription_required" varchar(20) NOT NULL, "image_url" varchar(200) NULL, "is_active" bool NOT NULL, "is_featured" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "total_sales" integer unsigned NOT NULL CHECK ("total_sales" >= 0), "category_id" bigint NOT NULL REFERENCES "medicine_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "cart_items" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "item_type" varchar(20) NOT NULL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "unit_price" decimal NOT NULL, "total_price" decimal NOT NULL, "rental_period" varchar(20) NOT NULL, "rental_start_date" date NULL, "rental_end_date" date NULL, "added_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "cart_id" bigint NOT NULL REFERENCES "carts" ("id") DEFERRABLE INITIALLY DEFERRED, "equipment_id" bigint NULL REFERENCES "equipments" ("id") DEFERRABLE INITIALLY DEFERRED, "medicine_id" bigint NULL REFERENCES "medicines" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmacy_wishlists" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "added_at" datetime NOT NULL, "medicine_id" bigint NOT NULL REFERENCES "medicines" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmacy_order_items" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "unit_price" decimal NOT NULL, "total_price" decimal NOT NULL, "medicine_id" bigint NOT NULL REFERENCES "medicines" ("id") DEFERRABLE INITIALLY DEFERRED, "order_id" bigint NOT NULL REFERENCES "pharmacy_orders" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "equipment_categories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "slug" varchar(150) NOT NULL UNIQUE, "description" text NOT NULL, "created_at" datetime NULL, "display_order" integer unsigned NOT NULL CHECK ("display_order" >= 0), "is_active" bool NOT NULL, "updated_at" datetime NULL);
CREATE TABLE IF NOT EXISTS "equipment_wishlists_equipment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "added_at" datetime NOT NULL, "equipment_id" bigint NOT NULL REFERENCES "equipments" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "equipment_purchases" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "order_number" varchar(50) NOT NULL UNIQUE, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "unit_price" decimal NOT NULL, "subtotal" decimal NOT NULL, "delivery_charge" decimal NOT NULL, "discount" decimal NOT NULL, "total_amount" decimal NOT NULL, "status" varchar(20) NOT NULL, "delivery_address" text NOT NULL, "delivery_phone" varchar(20) NOT NULL, "delivery_instructions" text NOT NULL, "warranty_months" integer unsigned NOT NULL CHECK ("warranty_months" >= 0), "warranty_expires_at" date NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "customer_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "equipment_id" bigint NOT NULL REFERENCES "equipments" ("id") DEFERRABLE INITIALLY DEFERRED, "customer_notes" text NOT NULL);
CREATE TABLE IF NOT EXISTS "equipment_rentals" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rental_number" varchar(50) NOT NULL UNIQUE, "rental_period" varchar(20) NOT NULL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "start_date" date NOT NULL, "end_date" date NOT NULL, "rental_price" decimal NOT NULL, "security_deposit" decimal NOT NULL, "delivery_address" text NOT NULL, "delivery_phone" varchar(20) NOT NULL, "delivery_instructions" text NOT NULL, "delivery_charge" decimal NOT NULL, "late_fee" decimal NOT NULL, "damage_charge" decimal NOT NULL, "total_amount" decimal NOT NULL, "deposit_paid" bool NOT NULL, "deposit_refunded" bool NOT NULL, "condition_at_delivery" text NOT NULL, "condition_at_return" text NOT NULL, "damage_notes" text NOT NULL, "status" varchar(20) NOT NULL, "actual_return_date" date NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "customer_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "equipment_id" bigint NOT NULL REFERENCES "equipments" ("id") DEFERRABLE INITIALLY DEFERRED, "customer_notes" text NOT NULL);
CREATE TABLE IF NOT EXISTS "sms_logs" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "phone_number" varchar(15) NOT NULL, "message" text NOT NULL, "sms_type" varchar(50) NOT NULL, "status" varchar(20) NOT NULL, "error_message" text NOT NULL, "sent_at" datetime NULL, "created_at" datetime NOT NULL, "recipient_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "notification_preferences" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "enable_in_app" bool NOT NULL, "enable_email" bool NOT NULL, "appointment_emails" bool NOT NULL, "order_emails" bool NOT NULL, "payment_emails" bool NOT NULL, "marketing_emails" bool NOT NULL, "enable_sms" bool NOT NULL, "appointment_sms" bool NOT NULL, "order_sms" bool NOT NULL, "payment_sms" bool NOT NULL, "enable_push" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
