CREATE TABLE IF NOT EXISTS "notifications" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "notification_type" varchar(50) NOT NULL, "title" varchar(200) NOT NULL, "message" text NOT NULL, "object_id" integer unsigned NULL CHECK ("object_id" >= 0), "action_url" varchar(500) NOT NULL, "action_text" varchar(100) NOT NULL, "is_read" bool NOT NULL, "read_at" datetime NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "pharmacy_order_activities" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "activity_type" varchar(40) NOT NULL, "title" varchar(200) NOT NULL, "message" text NOT NULL, "metadata" text NULL CHECK ((JSON_VALID("metadata") OR "metadata" IS NULL)), "created_at" datetime NOT NULL, "actor_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "order_id" bigint NOT NULL REFERENCES "pharmacy_orders" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "payments" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" decimal NOT NULL, "payment_status" varchar(20) NOT NULL, "transaction_id" varchar(100) NOT NULL, "payment_proof_url" varchar(200) NULL, "verified_at" datetime NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "payment_date" datetime NULL, "notes" text NOT NULL, "appointment_id" bigint NULL REFERENCES "appointments" ("id") DEFERRABLE INITIALLY DEFERRED, "patient_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "verified_by_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_proof_file" varchar(100) NULL, "equipment_purchase_id" bigint NULL REFERENCES "equipment_purchases" ("id") DEFERRABLE INITIALLY DEFERRED, "equipment_rental_id" bigint NULL REFERENCES "equipment_rentals" ("id") DEFERRABLE INITIALLY DEFERRED, "pharmacy_order_id" bigint NULL REFERENCES "pharmacy_orders" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_method" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "blog_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "slug" varchar(120) NOT NULL UNIQUE, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "blog_post" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "slug" varchar(255) NOT NULL UNIQUE, "excerpt" text NOT NULL, "content" text NOT NULL, "featured_image" varchar(100) NULL, "status" varchar(10) NOT NULL, "published_at" datetime NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "author_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NULL REFERENCES "blog_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "role" varchar(20) NOT NULL, "phone_number" varchar(15) NOT NULL, "address" text NOT NULL, "date_of_birth" date NULL, "emergency_contact" varchar(15) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_verified" bool NOT NULL, "profile_image" varchar(100) NULL);
