CREATE TABLE IF NOT EXISTS "services" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "slug" varchar(200) NOT NULL UNIQUE, "description" text NOT NULL, "short_description" varchar(300) NOT NULL, "base_price" decimal NOT NULL, "duration_unit" varchar(20) NOT NULL, "what_included" text NOT NULL, "requirements" text NOT NULL, "image_url" varchar(200) NULL, "is_active" bool NOT NULL, "is_featured" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "total_bookings" integer unsigned NOT NULL CHECK ("total_bookings" >= 0), "category_id" bigint NOT NULL REFERENCES "service_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL, "price_max" decimal NULL, "price_min" decimal NULL, "requires_security_deposit" bool NOT NULL, "security_deposit_amount" decimal NOT NULL, "security_deposit_description" text NOT NULL);
